import { getDesigne } from "../../data/data";
import { useParams } from "react-router-dom";
import { UserNav } from "../Navbar/homeNav";
import STLViewer from 'stl-viewer'
import cube from '../../images/stlFiles/Cube_3d.stl'
export default function DesignInfo(){
    let param = useParams();
    let design=getDesigne(param.designInfo);
    return(
        <div>
            <UserNav/>
        <div className="stl_render">
            <STLViewer
                    model={cube}
                    width={200}
                    height={200}
                    modelColor='green'
                    backgroundColor='gray'
                    orbitControls={true}
                    rotate={false}/>
            <div className="designInfo">                    
                <h3>{design.name}</h3>
                <p>{design.info}</p>
            </div>
        </div>
        </div>
    )


}
